import React from 'react';
import Header from '../Header';
import './Main.css';

export default function Main() {
    return (
        <div className="main">
        <Header/>

            <div className="container">

                    <h1>Boa noite</h1>

                <div className="item-column">
                    <div className="item">
                        <div className="image-default"></div>
                    </div>
                </div>

            </div>
        </div>
    )
}
